import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function UserCreate() {
  const navigate = useNavigate();

  const [form, setForm] = useState({
    name: "",
    email: "",
    role: "customer",
  });

  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");
  const [success, setSuccess] = useState("");

  const onChange = (e) => {
    const { name, value } = e.target;
    setForm((p) => ({ ...p, [name]: value }));
  };

  const onSubmit = async (e) => {
    e.preventDefault();
    setError("");
    setSuccess("");

    // tiny validation
    if (!form.name.trim() || !form.email.trim()) {
      setError("Please fill in name and email.");
      return;
    }

    setLoading(true);
    try {
      const res = await fetch("/api/users", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({
          name: form.name.trim(),
          email: form.email.trim(),
          role: form.role,
        }),
      });

      const data = await res.json().catch(() => ({}));

      if (!res.ok) {
        setError(data.message || "Failed to create user.");
        return;
      }

      setSuccess(`User created: ${data.email}`);
      setForm({ name: "", email: "", role: "customer" });

      // Optional: auto-go back to users list after success
      setTimeout(() => navigate("/admin/users"), 600);
    } catch (err) {
      setError(err.message || "Network error.");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ maxWidth: 520 }}>
      <h1 style={{ marginTop: 0 }}>Create User</h1>
      <p style={{ opacity: 0.8, marginTop: -6 }}>
        Create an account for a customer/viewer. (Admin accounts should usually be created manually.)
      </p>

      <form onSubmit={onSubmit} style={cardStyle}>
        <div style={fieldStyle}>
          <label style={labelStyle} htmlFor="name">Full Name</label>
          <input
            id="name"
            name="name"
            value={form.name}
            onChange={onChange}
            placeholder="e.g. Ali Alarab"
            style={inputStyle}
            disabled={loading}
          />
        </div>

        <div style={fieldStyle}>
          <label style={labelStyle} htmlFor="email">Email</label>
          <input
            id="email"
            name="email"
            type="email"
            value={form.email}
            onChange={onChange}
            placeholder="e.g. user@example.com"
            style={inputStyle}
            disabled={loading}
          />
        </div>

        <div style={fieldStyle}>
          <label style={labelStyle} htmlFor="role">Role</label>
          <select
            id="role"
            name="role"
            value={form.role}
            onChange={onChange}
            style={inputStyle}
            disabled={loading}
          >
            <option value="customer">Customer</option>
            <option value="viewer">Viewer (read-only)</option>
          </select>
        </div>

        {error && <div style={{ ...msgStyle, color: "#fca5a5" }}>{error}</div>}
        {success && <div style={{ ...msgStyle, color: "#a7f3d0" }}>{success}</div>}

        <div style={{ display: "flex", gap: 10, marginTop: 6 }}>
          <button type="submit" disabled={loading} style={primaryBtn}>
            {loading ? "Creating..." : "Create User"}
          </button>
          <button
            type="button"
            disabled={loading}
            style={secondaryBtn}
            onClick={() => navigate("/admin/users")}
          >
            Cancel
          </button>
        </div>
      </form>
    </div>
  );
}

/* simple styles (you can replace with your template CSS) */
const cardStyle = {
  marginTop: 16,
  padding: 16,
  borderRadius: 16,
  border: "1px solid rgba(148,163,184,0.35)",
};

const fieldStyle = { display: "grid", gap: 6, marginBottom: 12 };
const labelStyle = { fontSize: 13, opacity: 0.9 };

const inputStyle = {
  padding: "10px 12px",
  borderRadius: 12,
  border: "1px solid rgba(148,163,184,0.35)",
  background: "transparent",
  color: "inherit",
};

const msgStyle = { marginTop: 8, fontSize: 13 };

const primaryBtn = {
  padding: "10px 14px",
  borderRadius: 999,
  border: "1px solid rgba(148,163,184,0.35)",
  cursor: "pointer",
};

const secondaryBtn = {
  padding: "10px 14px",
  borderRadius: 999,
  border: "1px solid rgba(148,163,184,0.35)",
  background: "transparent",
  color: "inherit",
  cursor: "pointer",
};
